import React, { Component } from 'react'

export default class ListComponent extends Component {
    render() {
        return (
            <div>
                {this.props.listVideo.map((item, index) => {
                    return (
                        <p key={index.toString()}>
                            Name:  {item.name} --- ID: {item.id}
                        </p>
                    )
                })}
                <h1> MainComponent </h1>
            </div>
        )
    }
}
